pragma solidity ^0.8.0;
//import "./Marketplace.sol";

library func {

    //function that returns a * b and the requesting address 

	function toString(uint _i) internal pure returns (string memory _uintAsString) {
        if (_i == 0) {
            return "0";
        }
        uint j = _i;
        uint len;
        while (j != 0) {
            len++;
            j /= 10;
        }
        bytes memory bstr = new bytes(len);
        uint k = len;
        while (_i != 0) {
            k = k-1;
            uint8 temp = (48 + uint8(_i - _i / 10 * 10));
            bytes1 b1 = bytes1(temp);
            bstr[k] = b1;
            _i /= 10;
        }
        return string(bstr);
    }

	function removeDuplicateWords(string memory input) public pure returns (string memory) {
        string[] memory words = split(input, " ");
        string memory output;

        for(uint i = 0; i < words.length; i++) {
            bool isDuplicate = false;

            for(uint j = i + 1; j < words.length; j++) {
                if (keccak256(abi.encodePacked(words[i])) == keccak256(abi.encodePacked(words[j]))) {
                    isDuplicate = true;
                    break;
                }
            }

            if (!isDuplicate) {
                output = string(abi.encodePacked(output, words[i], " "));
            }
        }

        return output;
    }

    function split(string memory input, string memory delimiter) private pure returns (string[] memory) {
        bytes memory inputBytes = bytes(input);
        bytes memory delimiterBytes = bytes(delimiter);
        uint count = 1;

        for(uint i = 0; i < inputBytes.length; i++) {
            if (inputBytes[i] == delimiterBytes[0]) {
                count++;
            }
        }

        string[] memory parts = new string[](count);
        uint startIndex = 0;
        count = 0;

        for(uint i = 0; i < inputBytes.length; i++) {
            if (inputBytes[i] == delimiterBytes[0]) {
                parts[count] = substring(input, startIndex, i);
                startIndex = i + 1;
                count++;
            }
        }

        parts[count] = substring(input, startIndex, inputBytes.length);

        return parts;
    }

    function substring(string memory input, uint startIndex, uint endIndex) private pure returns (string memory) {
        bytes memory inputBytes = bytes(input);
        bytes memory result = new bytes(endIndex - startIndex);

        for(uint i = startIndex; i < endIndex; i++) {
            result[i - startIndex] = inputBytes[i];
        }

        return string(result);
    }




	function concatenate(string memory a, string memory b) public pure returns (string memory) {
        bytes memory aa = bytes(a);
        bytes memory bb = bytes(b);
        bytes memory result = new bytes(aa.length + bb.length);
        uint k = 0;
        for (uint i = 0; i < aa.length; i++) {
            result[k++] = aa[i];
        }
        for (uint i = 0; i < bb.length; i++) {
            result[k++] = bb[i];
        }
        return string(result);
    }

    function addressToString(address _addr) public pure returns (string memory) {
		bytes32 value = bytes32(uint256(uint160(_addr)));
		bytes memory alphabet = "0123456789abcdef";

		bytes memory str = new bytes(42);
		str[0] = '0';
		str[1] = 'x';
		for (uint i = 0; i < 20; i++) {
			str[2+i*2] = alphabet[uint8(value[i + 12] >> 4)];
			str[3+i*2] = alphabet[uint8(value[i + 12] & 0x0f)];
		}
		return string(str);
	}


 function splitAddresses(string memory input) public pure returns (address[] memory) {
        string[] memory tempArray = splitString(input);
        address[] memory addresses = new address[](tempArray.length);

        for (uint256 i = 0; i < tempArray.length; i++) {
            addresses[i] = parseAddress(tempArray[i]);
        }

        return addresses;
    }

    function splitString(string memory input) internal pure returns (string[] memory) {
        bytes memory bytesInput = bytes(input);
        uint256 count = 1;

        for (uint256 i = 0; i < bytesInput.length; i++) {
            if (bytesInput[i] == 0x20) { // ASCII code for space
                count++;
            }
        }

        string[] memory result = new string[](count);
        uint256 lastIndex = 0;
        uint256 currentIndex = 0;

        for (uint256 i = 0; i < bytesInput.length; i++) {
            if (bytesInput[i] == 0x20) { // ASCII code for space
                result[currentIndex] = substring2(input, lastIndex, i);
                lastIndex = i + 1;
                currentIndex++;
            }
        }

        result[currentIndex] = substring2(input, lastIndex, bytesInput.length);

        return result;
    }

    function substring2(string memory input, uint256 startIndex, uint256 endIndex) internal pure returns (string memory) {
        bytes memory bytesInput = bytes(input);
        bytes memory substringBytes = new bytes(endIndex - startIndex);

        for (uint256 i = startIndex; i < endIndex; i++) {
            substringBytes[i - startIndex] = bytesInput[i];
        }

        return string(substringBytes);
    }

    function parseAddress(string memory input) internal pure returns (address) {
        bytes memory addressBytes = bytes(input);
        bytes20 value;

        for (uint256 i = 0; i < 20; i++) {
            value |= bytes20(addressBytes[i]) >> (i * 8);
        }

        return address(value);
    }
}
